import React from 'react';

const Home = () => {
  return (
    <div className="p-4">
      <h1 className="text-2xl font-bold mb-4">Page d'accueil</h1>
      <p>Bienvenue sur Vinted Frontend.</p>
    </div>
  );
};

export default Home;
